        onClose();
      }
    };

    document.addEventListener('keydown', handleKeyDown);

    // Focus the panel when it opens
    if (panelRef.current) {
      panelRef.current.focus();
    }

    return () => {
      document.removeEventListener('keydown', handleKeyDown);
    };
  }, [onClose]);

  if (!item) return null;

